import React from "react";
import { BrowserRouter as Router, NavLink, Route, Routes } from "react-router-dom";

function Header() {
    return (
        <header>
            <div className="logo-container">
                <img
                    src="https://www.skrill.com/fileadmin/Personal/promotions/skrill-ac-milan/ac-milan.PNG"
                    alt="AC Milan Logo"
                    className="logo-img"
                />
                <span className="logo-text">AC Milan</span>
                <ul className="nav">
                    <li><NavLink to="/about" activeClassName="active-link">Про клуб</NavLink></li>
                    <li><NavLink to="/team" activeClassName="active-link">Основна команда</NavLink></li>
                    <li><NavLink to="/youth" activeClassName="active-link">Молодіжна команда</NavLink></li>
                </ul>
            </div>
            <div className="presentation"></div>
        </header>
    );
}

function About() {
    return <h2>Про клуб</h2>;
}

function Team() {
    return <h2>Основна команда</h2>;
}

function Youth() {
    return <h2>Молодіжна команда</h2>;
}

function App() {
    return (
        <Router>
            <div>
                <Header />
                <Routes>
                    <Route path="/about" element={<About />} />
                    <Route path="/team" element={<Team />} />
                    <Route path="/youth" element={<Youth />} />
                </Routes>
            </div>
        </Router>
    );
}

export default App;
